import React, {ReactNode} from 'react';

interface TodoHeaderType {
    children : ReactNode,
    loading : boolean,
}

function TodoHeader({children} : TodoHeaderType) {
    return (
        <header>
            {children}
        </header>
    );
}

export default TodoHeader;
